import { View, Text } from "react-native";
import React from "react";
import { TextInput, Button, Snackbar, HelperText } from "react-native-paper";
const NuevoMaterialScreen = ({navigation}) => {
  return (
    <View>
      <Text>NuevoMaterialScreen</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    paddingHorizontal: 16,
  },
  label: {
    fontSize: 16,
    marginBottom: 5,
  },
  input: {
    height: 40,
    borderColor: "gray",
    borderWidth: 1,
    marginBottom: 10,
    paddingHorizontal: 10,
  },
});
export default NuevoMaterialScreen;
